import React, { useState } from 'react';
import './App.css';
import { Line } from 'react-chartjs-2';
import exampleData from './exampleData'; // Tuodaan esimerkkidata

const App = () => {
  const [showChart1, setShowChart1] = useState(false);
  const [showChart2, setShowChart2] = useState(false);
  const [showChart3, setShowChart3] = useState(false);
  const [showChart4, setShowChart4] = useState(false);
  const [showChart5, setShowChart5] = useState(false);

  return (
    <div>
      <h1>Green House</h1>
      <button onClick={() => setShowChart1(!showChart1)}>
        {showChart1 ? 'Piilota Kaavio 1' : 'Näytä Kaavio 1'}
      </button>
      {showChart1 && (
        <div className="chart-container">
          <Line data={exampleData.data1} /> {/* Käytetään oikeaa esimerkkidataa */}
        </div>
      )}
      <button onClick={() => setShowChart2(!showChart2)}>
        {showChart2 ? 'Piilota Kaavio 2' : 'Näytä Kaavio 2'}
      </button>
      {showChart2 && (
        <div className="chart-container">
          <Line data={exampleData.data2} /> {/* Käytetään oikeaa esimerkkidataa */}
        </div>
      )}
      <button onClick={() => setShowChart3(!showChart3)}>
        {showChart3 ? 'Piilota Kaavio 3' : 'Näytä Kaavio 3'}
      </button>
      {showChart3 && (
        <div className="chart-container">
          <Line data={exampleData.data3} /> {/* Käytetään oikeaa esimerkkidataa */}
        </div>
      )}
      <button onClick={() => setShowChart4(!showChart4)}>
        {showChart4 ? 'Piilota Kaavio 4' : 'Näytä Kaavio 4'}
      </button>
      {showChart4 && (
        <div className="chart-container">
          <Line data={exampleData.data4} /> {/* Käytetään oikeaa esimerkkidataa */}
        </div>
      )}
      <button onClick={() => setShowChart5(!showChart5)}>
        {showChart5 ? 'Piilota Kaavio 5' : 'Näytä Kaavio 5'}
      </button>
      {showChart5 && (
        <div className="chart-container">
          <Line data={exampleData.data5} /> {/* Käytetään oikeaa esimerkkidataa */}
        </div>
      )}
    </div>
  );
};

export default App;
